def update_dropdown_values():
    # Get the current working directory (where the Python executable is located)
    current_directory = os.path.dirname(sys.argv[0])

    # Construct the file path for the Excel file in the current directory
    filepath = os.path.join(current_directory, "data.xlsx")

    try:
        if os.path.exists(filepath):
            df = pd.read_excel(filepath)

            # Assuming Full Name is in the first column and Profile is in the second column
            full_name_values = df['Nominatiro Professioniste'].dropna().unique().tolist()
            profile_values = df['Profilo'].dropna().unique().tolist()
            beneficiary_values = df['Beneficiary Name and Surname'].dropna().unique().tolist()

            full_name_combobox['values'] = full_name_values
            profile_combobox['values'] = profile_values
            beneficiary_combobox['values'] = beneficiary_values  # Corrected variable name
    except Exception as e:
        messagebox.showerror("Error", f"An error occurred while accessing the Excel file: {e}")

def clear_input_fields():
    full_name_combobox.set("")  # Set the value to an empty string
    profile_combobox.set("")
    beneficiary_combobox.set("")
    first_date_entry.delete(0, "end")  # Clear the content of the DateEntry widget
    second_date_entry.delete(0, "end")
    category_combobox.set("Seleziona categoria")
    service_combobox.set("Seleziona servizio")
    description_label_entry.delete("1.0", "end")

def enter_data(first_name, profile_name, beneficiary_name, date1, date2, cate, serv, desc):
    # Existing code for user data input

    # Get the current working directory (where the Python executable is located)
    current_directory = os.path.dirname(sys.argv[0])

    # Construct the file path for the Excel file in the current directory
    filepath = os.path.join(current_directory, "data.xlsx")

    try:
        if not os.path.exists(filepath):
            workbook = openpyxl.Workbook()
            sheet = workbook.active
            heading = ["Nominatiro Professioniste", "Profilo", "Beneficiorio Nome e Cognome", "Date de Inizio", "Date di Fine", "Categoria", "Servizio", "Descrizione"]
            sheet.append(heading)
            workbook.save(filepath)
            workbook = openpyxl.load_workbook(filepath)
            sheet = workbook.active
            sheet.append([first_name, profile_name, beneficiary_name, date1, date2, cate, serv, desc])
            workbook.save(filepath)
        else:
            workbook = openpyxl.load_workbook(filepath, read_only=False)
            sheet = workbook.active
            sheet.append([first_name, profile_name, beneficiary_name, date1, date2, cate, serv, desc])
            workbook.save(filepath)

        messagebox.showinfo("Success", "Data saved to Excel file successfully!")
        
        # Update the dropdown values after successfully saving the data
        update_dropdown_values()
        
         # Clear the input fields after successfully saving the data
        clear_input_fields()
        
    except Exception as e:
        messagebox.showerror("Error", f"An error occurred while accessing the Excel file: {e}")

def update_subcategories(event):
    selected_category = category_combobox.get()

    if selected_category in allowed_services.keys():
        subcategories = allowed_services[selected_category]
        service_combobox['values'] = subcategories
        service_combobox.current(0)  # Select the first subcategory by default
    else:
        service_combobox.set("")
        service_combobox['values'] = []

